import { DefaultTheme } from "styled-components";

export const DarkTheme: DefaultTheme = {
  SectionColor_R: "#545353",
  SectionColor_L: "#000",
  BasicColor: "#8588DD",
  textColor: "#000",
};

export const LightTheme: DefaultTheme = {
  SectionColor_R: "#FFF",
  SectionColor_L: "#8588DD",
  BasicColor: "#8588DD",
  textColor: "#000",
};
